package learnSelenium;

public class Ifelse_Concept {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		int D = 5;
		
		if(D>8) {
			System.out.println("Excellent");
		}
		
		else if (D<8) {
			System.out.println("Good");
		}

		else {
			System.out.println("Fair");
		}
				
	}

}
